import React, { useState } from "react";
import logo from "./assests/logo.gif";
import "./assests/style.css";

export default function NavBar() {
  const [items, setItems] = useState(false);
  return (
    <>
      <nav className="vs-navbar  flex-col navbar  navbar-light sticky-top">
        <div className="flexwrap removepadding navbar-container container-fluid">
          <a className="navbar-brand " href="#">
            <img src={logo} alt="" />
          </a>

          <button
            className="navbar-toggler text-light"
            type="button"
            data-bs-toggle="offcanvas"
            data-bs-target="#offcanvasDarkNavbar"
            aria-controls="offcanvasDarkNavbar"
            onClick={() => setItems(!items)}
          >
            {items ? (

<div class="navbar_menu_item_list" aria-describedby="popover-basic">
<button class="transparentoverlaybtn whatsapp-num">
  <i class="fa fa-bars undefined">
  //   <div className="links">
                   <ul>
                     <li>
                       <a href="#" className="an">
                         Login
                       </a>
                     </li>
                     <li>
                       <a href="#" className="an">
                         Profile
                       </a>
                     </li>
                     <li>
                       <a href="#" className="an">
                         Contact
                       </a>
                     </li>
                     <li>
                       <a href="#" className="an">
                         Logout
                       </a>
                     </li>
                   </ul>
                 </div>
  </i>
</button>
</div> 
              // <span className="navbar-toggler-icon  text-dark">
              //   <div className="links">
              //     <ul>
              //       <li>
              //         <a href="#" className="an">
              //           Login
              //         </a>
              //       </li>
              //       <li>
              //         <a href="#" className="an">
              //           Profile
              //         </a>
              //       </li>
              //       <li>
              //         <a href="#" className="an">
              //           Contact
              //         </a>
              //       </li>
              //       <li>
              //         <a href="#" className="an">
              //           Logout
              //         </a>
              //       </li>
              //     </ul>
              //   </div>
              // </span>)
              ): (
              <span className="navbar-toggler-icon"></span>
            )}
          </button>
        </div>
      </nav>
    </>
  );
}

